import React from "react";
import SearchPopup from "./SearchPopup";
import SearchList from "./SearchList";

import styles from "./SearchBody.module.css";

const SearchBody = () => {
  return (
    <div className={styles["search-body"]}>
      <SearchPopup />
      <SearchList />
    </div>
  );
};

export default SearchBody;
